css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("wikipedia.org") {

  html {
   background: #111;
   color: #edc;
  }
  body {
    background: #111;
    color: #ddd;
  }
  .mw-body {
    border: solid 1px #555;
    background: #222;
    color: #aaa;
  }
  #p-logo a {
    background-image: url("https://upload.wikimedia.org/wikipedia/en/8/80/Wikipedia-logo-v2.svg") !important;
  }
  #mw-navigation, #mw-navigation * {
    background: #111;
  }
  #mw-navigation a {
    color: #ba8 !important;
  }
  #content a {
    color: #859575 !important;
  }
  
  #mw-content-text div, #mw-content-text table, #catlinks {
    background: #333 !important;
  }
  
  .MainPageBG {
    background: #222 !important;
  }
  
  div.thumb .thumbimage {
    background: #888;
  }
  div#simpleSearch input {
    background: #333;
    color: #ddd;
  }
  h1, h2, h3, h4, h5, h6 {
    color: #eee;
  }
  a {
    color: #444;
  }
  div.thumbinner {
    background: #333;
  }
  
  th.navbox-title, th.navbox-title *, th.navbox-title * *, th.navbox-title div {
    background: #444 !important;
  }
  #collapsibleTable0 tr th div, #collapsibleTable1 tr th div,#collapsibleTable2 tr th div,#collapsibleTable3 tr th div,#collapsibleTable4 tr th div {
     background: #444 !important;
  }
  
  th {
    background: #443 !important;
  }
  #wpTextbox1, #wpTextbox1, .mw-ui-input, textarea {
     background: #222 !important;
    color: #ccc;
  }

  .fileinfo-paramfield {
    background: #282020;
  }
  
  ul#filetoc {
    background: #282820;
  }
}
